import os
import torch
import torchvision
import random
import math

class CropUpperRight(torch.nn.Module):
    def __init__(self, w):
        super(CropUpperRight, self).__init__()
        self.w = w

    def forward(self, img):
        return img[:,:,:self.w,-self.w:]

class Phys101(object):
    """Data Handler that loads Physics 101."""

    def __init__(self, data_root, camera='Kinect_RGB_1',train=True,
                 seq_len=20, image_size=64, length=-1, percent_train=.8,
                 center_crop=1080, crop_upper_right=1080,
                 only_twenty_degree=False, frame_step=1, subseq='middle',
                 shuffle=False, horiz_flip=False):
        '''
        if length == -1, use all sequences available
        '''
        self.data_root = data_root 
        self.camera = camera
        self.seq_len = seq_len
        self.image_size = image_size
        self.frame_step = frame_step
        self.subseq = subseq
        self.d = 0
        self.use_cached_lengths = 'ramp' in self.data_root and only_twenty_degree
        self.dirs = []
        if self.use_cached_lengths:
            self.dirs = [s[1] for s in filter(lambda x: math.ceil(x[0] / frame_step) >= self.seq_len, ramp_20_seq_lengths)]
        else:
            for d1 in os.listdir(self.data_root):
                for d2 in os.listdir(os.path.join(self.data_root, d1)):
                    if (not only_twenty_degree) or ('ramp' not in self.data_root) or ('ramp' in self.data_root and only_twenty_degree and '20' in d2):
                        for d3 in os.listdir(os.path.join(self.data_root, d1, d2)):
                            fname = os.path.join(data_root, d1, d2, d3, f'{camera}.mp4')
                            self.dirs.append(fname)
        if shuffle:
            print('shuffling dataset')
            random.Random(1612).shuffle(self.dirs)
        if length > 0:
            print(f'trimming dataset from length {len(self.dirs)} to {length}')
            self.dirs = self.dirs[:length]
        if train:
            self.dirs = self.dirs[:int(len(self.dirs)*percent_train)]
        else:
            self.dirs = self.dirs[int((len(self.dirs)+1)*percent_train):]
        if horiz_flip:
            print('randomly flipping images horizontally (p=.5)')
            self.transformations = transformations = torch.nn.Sequential(
                torchvision.transforms.CenterCrop(center_crop),
                torchvision.transforms.Resize((image_size, image_size)),
                torchvision.transforms.RandomHorizontalFlip(p=0.5),
            )
        else:
            self.transformations = transformations = torch.nn.Sequential(
                torchvision.transforms.CenterCrop(center_crop),
                torchvision.transforms.Resize((image_size, image_size)),
            )
        print(f"Initialized {'train' if train else 'test'} dataset with {len(self.dirs)} examples")

    def __len__(self):
        return len(self.dirs)

    def get_seq(self):
        d = self.dirs[self.d]
        if self.d == len(self.dirs) - 1:
            self.d = 0
        else:
            self.d+=1

        vid = torchvision.io.read_video(d, pts_unit='sec')[0]  # only take the video frames
        if self.frame_step > 1:
            vid = vid[::self.frame_step]  # only take the video frames

        if self.subseq == 'middle' and (vid.size(0) - self.seq_len) // 2 >= 0 \
              and (vid.size(0) + self.seq_len) // 2 <= vid.size(0):
            vid = vid[(vid.size(0) - self.seq_len) // 2:(vid.size(0) + self.seq_len) // 2]
            vid = self.transformations(vid.permute(0,3,1,2)).permute(0,2,3,1) / 255.
            return vid
        elif self.subseq == 'start' and vid.size(0) >= self.seq_len + 8//self.frame_step:
            vid = vid[8//self.frame_step:8//self.frame_step + self.seq_len]
            vid = self.transformations(vid.permute(0,3,1,2)).permute(0,2,3,1) / 255.
            return vid
        print(f'you asked for seq length {self.seq_len * self.frame_step + 8}, but sequence only has length {self.frame_step * vid.size(0)}.')
        print('taking next sequence...')
        return self.get_seq()
              
    def __getitem__(self, index):
        return self.get_seq()


